import React from 'react'
import './App.css';

import deliverizelogo1 from '../src/imgs/deliverizelogo1.png';
import deliverizelogo2 from '../src/imgs/deliverizelogo2.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav>
          <div className="nav__logo1"><img src={deliverizelogo1} /></div>
          <div className="nav__logo2"><img src={deliverizelogo2} /></div>
          <div className="nav__background">
            <h1 className="nav__background_entrega">Entrega</h1><br></br>
            <h1 className="nav__background_endereco">R: Antonie Braune, 222</h1>
          </div>
          <div className="nav__Container">
            <form>
              <input className="nav__inputplaceholder" type="text" placeholder=" Busque por estabelecimento ou produtos"></input>
            </form>
          </div>
          <div className="nav__busca">Buscar</div>
        </nav>
      </header>
    </div>
  );
}

export default App;
